{
    "config": {
        "GENERIC_SIM": {
            "Age_Initialization_Distribution_Type": {
                "type": "enum",
                "enum": [
                    "DISTRIBUTION_OFF",
                    "DISTRIBUTION_SIMPLE",
                    "DISTRIBUTION_COMPLEX"
                ],
                "description": "Method for initializing the age distribution in the simulated population. Possible values are: DISTRIBUTION_OFF - All individuals default to age 20-years-old. DISTRIBUTION_SIMPLE - Individual ages are drawn from a distribution whose functional form and parameters are specified in the 'IndividualAttributes' demographics input layers: 'AgeDistributionFlag', 'AgeDistribution1', and 'AgeDistribution2'. DISTRIBUTION_COMPLEX - Individual ages are drawn from a piecewise linear distribution specified in the 'IndividualAttributes' demographics input layer 'AgeDistribution'."
            },
            "Incubation_Period_Distribution": {
                "type": "enum",
                "enum": [
                    "FIXED_DURATION",
                    "EXPONENTIAL_DURATION"
                ],
                "description": "Distribution of duration of incubation period. Can be fixed or exponentially distributed with an average duration from Base_Incubation_Period. Possible values are: FIXED_DURATION and EXPONENTIAL_DURATION."
            },
            "Individual_Sampling_Type": {
                "type": "enum",
                "enum": [
                    "TRACK_ALL",
                    "FIXED_SAMPLING",
                    "ADAPTED_SAMPLING_BY_POPULATION_SIZE",
                    "ADAPTED_SAMPLING_BY_AGE_GROUP",
                    "ADAPTED_SAMPLING_BY_AGE_GROUP_AND_POP_SIZE"
                ],
                "description": "Type of individual human sampling. Possible values are: TRACK_ALL, FIXED_SAMPLING, ADAPTED_SAMPLING_BY_POPULATION_SIZE, ADAPTED_SAMPLING_BY_AGE_GROUP, and ADAPTED_SAMPLING_BY_AGE_GROUP_AND_POP_SIZE."
            },
            "Infectious_Period_Distribution": {
                "type": "enum",
                "enum": [
                    "FIXED_DURATION",
                    "EXPONENTIAL_DURATION"
                ],
                "description": "Distribution of duration of infectious period. Can be fixed or exponentially distributed with an average duration from Base_Infectious_Period. Possible values are: FIXED_DURATION, EXPONENTIAL_DURATION."
            },
            "Migration_Pattern": {
                "type": "enum",
                "enum": [
                    "RANDOM_WALK_DIFFUSION",
                    "SINGLE_ROUND_TRIPS",
                    "WAYPOINTS_HOME"
                ],
                "description": "The type of roundtrip. For example, a single roundtrip. Possible values are: RANDOM_WALK_DIFFUSION, SINGLE_ROUND_TRIPS and WAYPOINTS_HOME."
            },
            "Migration_Model": {
                "type": "enum",
                "enum": [
                    "NO_MIGRATION",
                    "FIXED_RATE_MIGRATION",
                    "VARIABLE_RATE_MIGRATION",
                    "LEVY_FLIGHTS"
                ],
                "description": "Model to use for migration. Possible values are: NO_MIGRATION, FIXED_RATE_MIGRATION, VARIABLE_RATE_MIGRATION and  LEVY_FLIGHTS.  Note: VARIABLE_RATE_MIGRATION and LEVY FLIGHTS are currently not supported."
            },
            "Mortality_Time_Course": {
                "type": "enum",
                "enum": [
                    "DAILY_MORTALITY",
                    "MORTALITY_AFTER_INFECTIOUS"
                ],
                "description": "Determines whether disease deaths are calculated on every time step or once at the end of the disease duration. Possible values are: DAILY_MORTALITY and MORTALITY_AFTER_INFECTIOUS."
            },
            "Pool_Transmission_Mode": {
                "type": "enum",
                "enum": [
                    "ENVIRONMENTAL_AND_CONTACT_TRANSMISSION",
                    "ENVIRONMENTAL_TRANSMISSION",
                    "CONTACT_TRANSMISSION"
                ],
                "description": "The mode of transmission (environmental, contact or both) when the mixing pool option is turned on. Possible values are: ENVIRONMENTAL_AND_CONTACT_TRANSMISSION, ENVIRONMENTAL_TRANSMISSION and CONTACT_TRANSMISSION.   "
            },
            "Population_Density_Infectivity_Correction": {
                "type": "enum",
                "enum": [
                    "CONSTANT_INFECTIVITY",
                    "SATURATING_FUNCTION_OF_DENSITY"
                ],
                "description": "Correction to alter infectivity by population density set in the Population_Density_C50 parameter. Measured in people per sq. km. Possible values are:  CONSTANT_INFECTIVITY and SATURATING_FUNCTION_OF_DENSITY.   Note: Sparsely populated areas have a lower infectivity, while densely populated areas have a higher infectivity which rises to saturate at the Base_Infectivity value."
            },
            "Population_Scale_Type": {
                "type": "enum",
                "enum": [
                    "USE_INPUT_FILE",
                    "FIXED_SCALING"
                ],
                "description": "Either use the initial population specified in the demographics input file or a fixed scaling of this value based on the population scaling factor parameter. Possible values are: USE_INPUT_FILE and FIXED_SCALING."
            },
            "Random_Type": {
                "type": "enum",
                "enum": [
                    "USE_LINEAR_CONGRUENTIAL",
                    "USE_PSEUDO_DES"
                ],
                "description": "Type of random number generator used for a simulation. Possible values are: USE_LINEAR_CONGRUENTIAL and USE_PSEUDO_DES. Note: Currently, only USE_PSEUDO_DES is implemented.  Do not use USE_LINEAR_CONGRUENTIAL at this time."
            },
            "Infectivity_Scale_Type": {
                "type": "enum",
                "enum": [
                    "CONSTANT_INFECTIVITY",
                    "FUNCTION_OF_TIME_AND_LATITUDE",
                    "FUNCTION_OF_CLIMATE",
                    "EXPONENTIAL_FUNCTION_OF_TIME"
                ],
                "description": "Alter infectivity by time or season.  Possible values are: CONSTANT_INFECTIVITY - No infectivity correction is applied.  FUNCTION_OF_TIME_AND_LATITUDE - Infectivity is corrected for approximate seasonal forcing.  The use of a seasonal infectivity correction is a proxy for the effects of varying climate.  From October through March, infectivity increases in the Northern Hemisphere and decreases in the Southern Hemisphere.  From April through September, the trend reverses.  Regions closer to the equator have reduced forcing compared to temperate regions.  This is not a substitute for the weather-driven vector dynamics of vector-borne and malaria simulations.  FUNCTION_OF_CLIMATE - Allows infectivity to be modulated by weather directly, for example, relative humidity in airborne simulations or rainfall in waterborne simulations.  There is no default climate dependence enabled for generic simulations.  EXPONENTIAL_FUNCTION_OF_TIME - To facilitate certain burn-in scenarios, infectivity ramps up from zero at the beginning of the simulation according to the functional form, 1-exp(-rate*time), where the rate is specified by the parameter Infectivity_Scaling_Rate."
            },
            "Simulation_Type": {
                "type": "enum",
                "enum": [
                    "GENERIC_SIM",
                    "VECTOR_SIM",
                    "MALARIA_SIM",
                    "WATERBORNE_SIM",
                    "POLIO_SIM",
                    "AIRBORNE_SIM",
                    "TB_SIM"
                ],
                "description": "Type of disease being simulated. Possible values are: GENERIC_SIM, VECTOR_SIM, MALARIA_SIM, WATERBORNE_SIM, POLIO_SIM, AIRBORNE_SIM and TB_SIM."
            },
            "Visiting_Pool_Selection_Mode": {
                "type": "enum",
                "enum": [
                    "VISITINGPOOLONLY_RANDOMSELECTION",
                    "VISITINGPOOLONLY_SELECTBYPOOLPOPULATIONWEIGHT",
                    "SAMETYPEASHOME_RANDOMSELECTION",
                    "SAMETYPEASHOME_SELECTBYPOOLPOPULATIONWEIGHT"
                ],
                "description": "The mode of pool selection when the mixing pool option is turned on. Possible values are: VISITINGPOOLONLY_RANDOMSELECTION, VISITINGPOOLONLY_SELECTBYPOOLPOPULATIONWEIGHT, SAMETYPEASHOME_RANDOMSELECTION and SAMETYPEASHOME_SELECTBYPOOLPOPULATIONWEIGHT.  "
            },
            "Birth_Rate_Dependence": {
                "type": "enum",
                "enum": [
                    "FIXED_BIRTH_RATE",
                    "POPULATION_DEP_RATE",
                    "DEMOGRAPHIC_DEP_RATE",
                    "INDIVIDUAL_PREGNANCIES",
                    "INDIVIDUAL_PREGNANCIES_BY_AGE"
                ],
                "description": "This parameter determines how the birth rate specified in the demographics file is used. Possible values are: FIXED_BIRTH_RATE- The absolute rate at which new individuals are born. POPULATION_DEP_RATE - Scales the node population to determine the birth rate. DEMOGRAPHIC_DEP_RATE - Scales the female population within fertility age ranges to determine the birth rate. INDIVIDUAL_PREGNANCIES - Results in a similar birth rate as DEMOGRAPHIC_DEP_RATE, but pregnancies are assigned on an individual basis and result in a 40-week pregnancy for a specific individual with a birth at the end, and INDIVIDUAL_PREGNANCIES_BY_AGE"
            },
            "Infectivity_Scaling_Rate": {
                "description": "Only used or needed when Infectivity_Scale_Type is set to EXPONENTIAL_FUNCTION_OF_TIME.  Sets the rate at which the suppressed initial infectivity approaches its nominal value.",
                "type": "float",
                "min": 0,
                "max": 3.40282e+038,
                "default": 0
            },
            "Serialization_Test_Cycles": {
                "description": "Serialization_Test_Cycles",
                "type": "integer",
                "min": 0,
                "max": 2.14748e+009,
                "default": 1
            },
            "Demographics_Filename": {
                "description": "Path of demographics file containing information on the identity and demographics of the region to simulate.",
                "type": "string"
            },
            "Simulation_Duration": {
                "description": "Elapsed time noted in days from the start to the end of a simulation.",
                "type": "float",
                "min": 0,
                "max": 1e+006,
                "default": 1
            },
            "Simulation_Timestep": {
                "description": "Value indicating simulation time step in days.",
                "type": "float",
                "min": 0,
                "max": 1e+006,
                "default": 1
            },
