                "description": "Time noted in days when the simulation begins. This time influences the point in the temporal input data, such as where in the climate input the DTK starts running the simulation. Note: The Start_Day of campaign events is in absolute time. So, time relative to the beginning of the simulation depends on this parameter.",
                "type": "float",
                "min": 0,
                "max": 1e+006,
                "default": 1
            },
            "Config_Name": {
                "description": "User-supplied title naming a configuration.",
                "type": "string"
            },
            "Enable_Demographics_Reporting": {
                "description": "Outputs demographic summary data and age-binned reports to file.",
                "type": "bool",
                "default": 1
            },
            "Enable_Demographics_Initial": {
                "description": "Uses demographics input files to configure the initial population. Enter 0 to use a standard testing sandbox which is useful for testing and validating code pathways.",
                "type": "bool",
                "default": 1
            },
            "Enable_Aging": {
                "description": "Set to 1 to account for aging in the population. Set to 0 to assume that the population does not age.",
                "type": "bool",
                "default": 1
            },
            "Enable_Vital_Dynamics": {
                "description": "Set to 1 as a master switch to enable vital dynamics (births and deaths). Set to 0 to disable vital dynamics. Even when set to 1, the individual toggles for births and deaths can still disable these.",
                "type": "bool",
                "default": 1
            },
            "Enable_Disease_Mortality": {
                "description": "Set to 1 to enable disease mortality. Set to 0 to disable disease mortality.",
                "type": "bool",
                "default": 1
            },
            "Enable_Nondisease_Mortality": {
                "description": "Set to 1 to enable non-disease mortality, such as death by natural causes. Set to 0 to disable non-disease mortality.",
                "type": "bool",
                "default": 1
            },
            "x_Other_Mortality": {
                "description": "Multiplier for scaling mortality from causes other than disease being simulated.",
                "type": "float",
                "min": 0,
                "max": 3.40282e+038,
                "default": 1
            },
            "Max_Individual_Infections": {
                "description": "Limit on the number of infections that an individual can have simultaneously. Note: Relevant only if the Enable_Superinfection parameter is set to 1 to allow multiple infections.",
                "type": "integer",
                "min": 0,
                "max": 1000,
                "default": 1
            },
            "Node_Grid_Size": {
                "description": "Spatial resolution indicating the node grid size for a simulation in degrees.",
                "type": "float",
                "min": 0.004167,
                "max": 90,
                "default": 0.004167
            },
            "Enable_Mixing_Pools": {
                "description": "Set to 1 to enable the mixing pool structure. Requires pool types and definitions files to be specified and present. Set to 0 to disable.",
                "type": "bool",
                "default": 0
            },
            "Individual_Mixing_Pool_Link_Update_Frequency": {
                "description": "Frequency to update individual mixing pool relationships, to eliminate expired links, and to add new links. Available only when mixing pool structure is turned on. If the value is 0, the link stays constant throughout the simulation.",
                "type": "integer",
                "min": 0,
                "max": 2.14748e+009,
                "default": 0
            },
            "Enable_Air_Migration": {
                "description": "Set to 1 to account for migration by airplane in and out of cities with airports. Set to 0 to assume by default that no migration occurs by air travel.",
                "type": "bool",
                "default": 0
            },
            "Enable_Regional_Migration": {
                "description": "Set to 1 to account for migration by road vehicle in and out of nodal cities in the road network. Set to 0 to assume by default that no migration occurs by road travel.",
                "type": "bool",
                "default": 1
            },
            "Enable_Sea_Migration": {
                "description": "Set to 1 to account for migration on ships in and out of coastal cities with seaports. Set to 0 to assume by default that no migration occurs by sea travel.",
                "type": "bool",
                "default": 1
            },
            "Enable_Local_Migration": {
                "description": "Set to 1 to enable local migration, the diffusion of people in and out of nearby nodes by foot travel. Set to 0 to disable local migration.",
                "type": "bool",
                "default": 1
            },
            "Enable_Interventions": {
                "description": "Set to 1 to load campaign interventions from file. Set to 0 to run a baseline simulation without campaigns.",
                "type": "bool",
                "default": 1
            },
            "Enable_Superinfection": {
                "description": "Set to 1 if an individual can have multiple infections with the same agent simultaneously. Set to 0 if multiple infections are not possible. See the Max_Individual_Infections parameter.",
                "type": "bool",
                "default": 0
            },
            "Enable_Immunity": {
                "description": "Set to 1 if an individual has protective immunity after an infection clears. Set to 0 if recovery from the infection does not affect the individual's future immunity.",
                "type": "bool",
                "default": 1
            },
            "Infection_Updates_Per_Timestep": {
                "description": "Number of infection updates executed during each timestep. A timestep defaults to one day.",
                "type": "integer",
                "min": 0,
                "max": 2.14748e+009,
                "default": 1
            },
            "Number_Basestrains": {
                "description": "The number of base strains in the simulation, such as antigenic variants.",
                "type": "integer",
                "min": 1,
                "max": 10,
                "default": 1
            },
            "Number_Substrains": {
                "description": "The number of disease substrains for each base strain, such as genetic variants.",
                "type": "integer",
                "min": 1,
                "max": 512,
                "default": 256
            },
            "Enable_Immunity_Initialization_Distribution": {
                "description": "Enables immunity initialization distribution.",
                "type": "bool",
                "default": 0
            }
        },
